#![no_std]
#![no_main] use esp32c3_hal::{clock::ClockControl, pac::Peripherals, prelude::*, timer::TimerGroup, Rtc};
use esp_backtrace as _; #[riscv_rt::entry]
fn main() -> ! { let peripherals = Peripherals::take().unwrap(); let system = peripherals.SYSTEM.split(); let clocks = ClockControl::boot_defaults(system.clock_control).freeze(); // Disable the RTC and TIMG watchdog timers let mut rtc = Rtc::new(peripherals.RTC_CNTL); let timer_group0 = TimerGroup::new(peripherals.TIMG0, &clocks); let mut wdt0 = timer_group0.wdt; let timer_group1 = TimerGroup::new(peripherals.TIMG1, &clocks); let mut wdt1 = timer_group1.wdt; rtc.swd.disable(); rtc.rwdt.disable(); wdt0.disable(); wdt1.disable(); loop {}
} That is quite a lot of code. Let's see what it is good for. #![no_std] this tells the Rust compiler that this code doesn't use libstd #![no_main] The no_main attribute says that this program won't use the standard main interface, which is tailored for command-line applications that receive arguments. Instead of the standard main, we'll use the entry attribute from the riscv-rt crate to define a custom entry point. In this program we have named the entry point main, but any other name could have been used. The entry point function must be a diverging function . I.e. it has the signature fn foo() -> !; this type indicates that the function never returns – which means that the program never terminates. use esp32c3_hal:{...} we need to bring in some types we are going to use these are from esp-hal use esp_backtrace as _; since we are in a bare-metal environment we need a panic-handler that runs if a panic occurs in code there are a few different crates you can use (e.g panic-halt) but esp-backtrace provides an implementation that prints the address of a backtrace - together with espflash/espmonitor these addresses can get decoded into source code locations let peripherals = Peripherals::take().unwrap(); HAL drivers usually take ownership of peripherals accessed via the PAC here we take all the peripherals from the PAC to pass them to the HAL drivers later let system = peripherals.SYSTEM.split(); sometimes a peripheral (here the System peripheral) is coarse-grained and doesn't exactly fit the HAL drivers - so here we split the System peripheral into smaller pieces which get passed to the drivers let clocks = ClockControl::boot_defaults(system.clock_control).freeze(); here we configure the system clocks - in this case, we are fine with the defaults we freeze the clocks which means we cannot change them later some drivers need a reference to the clocks to know how to calculate rates and durations the next block of code instantiates some peripherals (namely RTC and the two timer groups) to disable the watchdog which is armed after boot without that code, the SoC would reboot after some time there is another way to prevent the reboot: feeding the watchdog loop {} since our function is supposed to never return we just "do nothing" in a loop

