Interrupts offer a mechanism by which the processor handles asynchronous events and fatal errors. Let's add the critical-section crate (see instructions on how to add a dependency) , and change main.rs to look like this: #![no_std]
#![no_main] use core::cell::RefCell;
use critical_section::Mutex;
use esp32c3_hal::{ clock::ClockControl, gpio::Gpio9, gpio_types::{Event, Input, Pin, PullUp}, interrupt, pac::{self, Peripherals}, prelude::*, timer::TimerGroup, Rtc, IO,
};
use esp_backtrace as _; static BUTTON: Mutex<RefCell<Option<Gpio9<Input<PullUp>>>>> = Mutex::new(RefCell::new(None)); #[riscv_rt::entry]
fn main() -> ! { let peripherals = Peripherals::take().unwrap(); let system = peripherals.SYSTEM.split(); let clocks = ClockControl::boot_defaults(system.clock_control).freeze(); // Disable the RTC and TIMG watchdog timers let mut rtc = Rtc::new(peripherals.RTC_CNTL); let timer_group0 = TimerGroup::new(peripherals.TIMG0, &clocks); let mut wdt0 = timer_group0.wdt; let timer_group1 = TimerGroup::new(peripherals.TIMG1, &clocks); let mut wdt1 = timer_group1.wdt; rtc.swd.disable(); rtc.rwdt.disable(); wdt0.disable(); wdt1.disable(); // Set GPIO9 as input let io = IO::new(peripherals.GPIO, peripherals.IO_MUX); let mut button = io.pins.gpio9.into_pull_up_input(); button.listen(Event::FallingEdge); // raise interrupt on falling edge critical_section::with(|cs| BUTTON.borrow_ref_mut(cs).replace(button)); interrupt::enable(pac::Interrupt::GPIO, interrupt::Priority::Priority3).unwrap(); loop {}
} #[interrupt]
fn GPIO() { critical_section::with(|cs| { esp_println::println!("GPIO interrupt"); BUTTON .borrow_ref_mut(cs) .as_mut() .unwrap() .clear_interrupt(); });
} There are quite a lot of new things here. First thing is the static BUTTON. We need it since in the interrupt handler we have to clear the pending interrupt on the button and we somehow need to pass the button from main to the interrupt handler. Since an interrupt handler can't have arguments we need a static to get the button into the interrupt handler. We need the Mutex to make access to the button safe. Please note that this is not the Mutex you might know from libstd but it's the Mutex from critical-section (and that's why we need to add it as a dependency). Then we need to call listen on the output pin to configure the peripheral to raise interrupts. We can raise interrupts for different events - here we want to raise the interrupt on the falling edge. In the next line we move our button into the static BUTTON for the interrupt handler to get hold of it. Last thing we need to do is actually enable the interrupt. First parameter here is the kind of interrupt we want. There are several possible interrupts . Second parameter is the priority of the interrupt. The interrupt handler is defined via the #[interrupt] macro. Here the name of the function must match the interrupt.
